package com.plter.swfplayerext.data;

import android.graphics.Bitmap;
import android.graphics.BitmapFactory;
import android.util.Base64;

public class Images {

	
	private static String dir="";
	private static String unknownFile="";
	private static String back="";
	private static String swfFile="";
	
	private static Bitmap _dirIconBitmap=null;
	public static Bitmap getDirIconBitmap(){
		if (_dirIconBitmap==null) {
			byte[] bytes = Base64.decode(dir, Base64.DEFAULT);
			_dirIconBitmap=BitmapFactory.decodeByteArray(bytes, 0, bytes.length);
		}
		return _dirIconBitmap;
	}
	
	private static Bitmap _unknownFileIconBitmap=null;
	public static Bitmap getUnknownFileIconBitmap(){
		if (_unknownFileIconBitmap==null) {
			
			byte[] bytes = Base64.decode(unknownFile, Base64.DEFAULT);
			_unknownFileIconBitmap=BitmapFactory.decodeByteArray(bytes, 0, bytes.length);
		}
		return _unknownFileIconBitmap;
	}
	
	private static Bitmap _backIconBitmap=null;
	public static Bitmap getBackIconBitmap(){
		if (_backIconBitmap==null) {
			
			byte[] bytes = Base64.decode(back, Base64.DEFAULT);
			_backIconBitmap=BitmapFactory.decodeByteArray(bytes, 0, bytes.length);
		}
		return _backIconBitmap;
	}
	
	private static Bitmap _swfFileIconBitmap=null;
	public static Bitmap getSwfFileIconBitmap(){
		if (_swfFileIconBitmap==null) {
			
			byte[] bytes = Base64.decode(swfFile, Base64.DEFAULT);
			_swfFileIconBitmap=BitmapFactory.decodeByteArray(bytes, 0, bytes.length);
		}
		return _swfFileIconBitmap;
	}
}
